    pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import '../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol';
import './SBT5484.sol';

//SPDX-License-Identifier: UNLICENSED
contract Transactions is ERC20 {

    address admin;
    Soulbound soulbound ;
    uint id = 0;

    constructor(address contractAddress) ERC20("Carbon", "C") public {
        admin = msg.sender;
        verifier[admin] = true;
        soulbound = Soulbound(contractAddress);
        emit Verifier(admin, msg.sender, block.timestamp);
    }

    event Claim(address creditHolderAddress, uint amount, uint256 time);
    event Approve(address HolderAddress, uint amount, uint256 time, address verifierAddress);
    event Burn(address HolderAddress, uint amount, uint256 time);
    event Sale(address creditHolderAddress, uint amount, uint256 time);
    event Buy(address from, address to , uint amount, uint256 time);
    event Verifier(address add, address addedBy, uint256 time);

    mapping (address => bool) verifier;
    mapping (address => uint) claims;
    mapping (address => uint) sales;
    mapping (address => uint) burn;
    mapping (address => uint) reward;

    modifier onlyVerifier() {
        require(verifier[msg.sender] == true);
        _;
    }

    function addVerifiers(address verifierAddress) public onlyVerifier{
        verifier[verifierAddress]= true;
        emit Verifier(verifierAddress, msg.sender, block.timestamp);
    }

    // seller claims credit token:
    function claimCarbonToken(uint credit) public {
        claims[msg.sender] += credit;
        emit Claim(msg.sender, credit, block.timestamp);
     }

    function checkSalesbalance(address cAddress) public view returns(uint){
        return sales[cAddress];
    }

    // Approver approves credit holder: 
    function approveCreditsHeld(address _holder) public onlyVerifier {
        _mint(_holder, claims[_holder]);
        emit Approve(_holder, claims[_holder] , block.timestamp , msg.sender);
        claims[_holder] = 0;
    }

    // Approver rejects credit holder: 
    function rejectCreditsHeld(address _holder) public onlyVerifier {
        // emit Reject(_holder, claims[_holder] , block.timestamp, msg.sender);
        claims[_holder] = 0 ;
    }

    // Seller puts credits to sale:
    function onSale(uint tokenCount) public {
        require(sales[msg.sender] + tokenCount <= balanceOf(msg.sender)); 
        sales[msg.sender] += tokenCount;
        emit Sale(msg.sender, tokenCount, block.timestamp);
        approve(address(this), sales[msg.sender]);
    }

    // Buyer buys token:
    function buyToken(address payable seller, uint tokenC) public payable{
        require(sales[seller] >= tokenC);
        require(seller != msg.sender);
        this.transferFrom(seller, msg.sender, tokenC);
        sales[seller] -= tokenC;
        reward[seller] += msg.value;
        emit Buy(seller, msg.sender, tokenC, block.timestamp);
    }

    function checkReward(address add)  public view returns(uint){
        return reward[add];
    }   

    function claimReward(address payable add ) public payable {
        add.send(reward[add]);
        reward[add] = 0;
    }

    // Approver burns token:
    function burnToken( address add, uint tokenToBurn) public onlyVerifier {
        require(balanceOf(add) - sales[add] >= tokenToBurn);
        burn[add] += tokenToBurn;
        if(burn[add] >= 5)
        {
            soulbound.createSBT(add);
            burn[add] -= 5;
        }   
        _burn(add, tokenToBurn);
        emit Burn(add, tokenToBurn, block.timestamp); 
    }

    function sbtBalance(address holder) public view returns(uint256){
        return soulbound.balanceOf(holder);
    }

}
